import React, { useState } from 'react';
import { AppBar, Toolbar, Typography, Button, IconButton, Box, Drawer, List, ListItem, ListItemText, useMediaQuery, useTheme } from '@mui/material';
import { styled } from '@mui/material/styles';
import MenuIcon from '@mui/icons-material/Menu';
import { Link as RouterLink } from 'react-router-dom';
import YouTubeIcon from '@mui/icons-material/YouTube';

const StyledAppBar = styled(AppBar)({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.95) 0%, rgba(22, 33, 62, 0.95) 100%)',
  backdropFilter: 'blur(10px)',
  borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
  boxShadow: '0 4px 30px rgba(0, 0, 0, 0.1)',
});

const Logo = styled(Box)({
  display: 'flex',
  alignItems: 'center',
  gap: '0.5rem',
  textDecoration: 'none',
  color: 'white',
  '& .MuiSvgIcon-root': {
    color: '#673ab7',
    fontSize: '2rem',
  },
});

const NavButton = styled(Button)({
  color: 'white',
  margin: '0 0.5rem',
  '&:hover': {
    background: 'rgba(103, 58, 183, 0.1)',
  },
});

const DrawerContent = styled(Box)({
  width: 250,
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.98) 0%, rgba(22, 33, 62, 0.98) 100%)',
  height: '100%',
  color: 'white',
});

const StyledListItem = styled(ListItem)({
  '&:hover': {
    background: 'rgba(103, 58, 183, 0.1)',
  },
});

const navigationItems = [
  { text: 'الرئيسية', path: '/' },
  { text: 'المميزات', path: '/features' },
  { text: 'كيفية الاستخدام', path: '/how-to-use' },
  { text: 'حول', path: '/about' },
  { text: 'اتصل بنا', path: '/contact' },
];

const Header = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <DrawerContent>
      <List>
        <ListItem component={RouterLink} to="/" sx={{ justifyContent: 'center', mb: 2, mt: 2 }}>
          <Logo>
            <YouTubeIcon />
            <Typography variant="h6" component="span">
              YTDOWN
            </Typography>
          </Logo>
        </ListItem>
        {navigationItems.map((item) => (
          <StyledListItem
            button
            key={item.text}
            component={RouterLink}
            to={item.path}
            onClick={handleDrawerToggle}
          >
            <ListItemText 
              primary={item.text} 
              sx={{ 
                textAlign: 'center',
                '& .MuiTypography-root': {
                  color: 'white',
                }
              }}
            />
          </StyledListItem>
        ))}
      </List>
    </DrawerContent>
  );

  return (
    <>
      <StyledAppBar position="fixed">
        <Toolbar>
          {isMobile && (
            <IconButton
              color="inherit"
              aria-label="open drawer"
              edge="start"
              onClick={handleDrawerToggle}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
          )}

          <Logo component={RouterLink} to="/">
            <YouTubeIcon />
            <Typography variant="h6" component="span">
              YTDOWN
            </Typography>
          </Logo>

          <Box sx={{ flexGrow: 1 }} />

          {!isMobile && (
            <Box sx={{ display: 'flex' }}>
              {navigationItems.map((item) => (
                <NavButton
                  key={item.text}
                  component={RouterLink}
                  to={item.path}
                >
                  {item.text}
                </NavButton>
              ))}
            </Box>
          )}
        </Toolbar>
      </StyledAppBar>

      <Drawer
        variant="temporary"
        anchor="right"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true, // Better open performance on mobile
        }}
      >
        {drawer}
      </Drawer>

      {/* Toolbar placeholder to prevent content from hiding under AppBar */}
      <Toolbar />
    </>
  );
};

export default Header;
